import React from "react";

export default function Dashboard() {
  return (
    <div>
      <h1>Welcome to the Dashboard!</h1>
      <ul>
        <li>1. Add Student Attendance</li>
        <li>2. Add Student Result</li>
      </ul>
    </div>
  );
}
